(1, 1, 'Visi dan Misi', '<p><strong>Visi Kejaksaan R.I :</strong></p><ul></ul><p>Kejaksaan sebagai lembaga penegak hukum yang bersih, efektif, efisien, transparan, akuntabel, untuk dapat memberikan pelayanan prima dalam mewujudkan supremasi hukum secara profesional, proporsional dan bermartabat yang berlandaskan keadilan, kebenaran, serta nilai â€“ nilai kepautan.</p><p><strong>Misi Kejaksaan R.I :</strong></p><ul></ul><ol><li>Mengoptimalkan pelaksanaan fungsi Kejaksaan dalam pelaksanaa tugas dan wewenang, baik dalam segi kualitas maupun kuantitas penanganan perkara seluruh tindak pidana, penanganan perkara Perdata dan Tata Usaha Negara, serta pengoptimalan kegiatan Intelijen Kejaksaan, secara profesional, proposional dan bermartabat melalui penerapan Standard Operating Procedure (SOP) yang tepat, cermat, terarah, efektif, dan efisien.</li><li>Mengoptimalkan peranan bidang Pembinaan dan Pengawasan dalam rangka mendukung pelaksanaan tugas bidang-bidang lainnya, terutama terkait dengan upaya penegakan hukum.</li><li>Mengoptimalkan tugas pelayanan publik di bidang hukum dengan penuh tanggung jawab, taat azas, efektif dan efisien, serta penghargaan terhadap hak-hak publik;</li><li>Melaksanakan pembenahan dan penataan kembali struktur organisasi Kejaksaan, pembenahan sistem informasi manajemen terutama pengimplementasian program quickwins agar dapat segera diakses oleh masyarakat, penyusunan cetak biru (blue print) pembangunan sumber daya manusia Kejaksaan jangka menengah dan jangka panjangtahun 2025, menerbitkan dan menata kembali manajemen administrasi keuangan, peningkatan sarana dan prasarana, serta peningkatan kesejahteraan pegawai melalui tunjangan kinerja atau remunerasi, agar kinerja Kejaksaan dapat berjalan lebih efektif, efisien, transparan, akuntabel dan optimal.</li><li>Membentuk aparat Kejaksaan yang handal, tangguh, profesional, bermoral dan beretika guna menunjang kelancaran pelaksanaan tugas pokok, fungsi dan wewenang, terutama dalam upaya penegakan hukum yang berkeadilan serta tugas-tugas lainnya yang terkait.</li></ol><p>(Sumber: Peraturan Jaksa Agung No: 011/A/JA/01/2010 tentang Rencana Strategis Kejaksaan Republik Indonesia Tahun 2010-2014 tanggal 28 Januari 2010)</p>', 'published', 'pembinaan', '2015-01-21 11:47:22', '2015-01-22 01:08:14', NULL),
(2, 1, 'Corporis odio totam excepturi illum vel ea tenetur.', 'Sequi impedit et porro delectus. Dicta quidem ut omnis cupiditate delectus minima quidem. Eos sunt animi voluptatem. Laudantium perspiciatis ut corrupti qui. Sapiente sint rerum dolorem quia qui alias mollitia mollitia. Est sapiente est accusantium molestiae ea odio animi iusto. Cupiditate ut officiis error aspernatur eos.', 'published', 'intelijen', '2015-01-21 11:47:22', '2015-01-21 11:47:22', NULL),
(3, 1, 'Reprehenderit laborum animi illo incidunt.', 'Impedit praesentium molestiae et non. Similique sed quis suscipit. Cum dolore enim in vero in. Eos tempore ut dolore ut debitis et. Vero repellat ea et. Nostrum veritatis quo molestias adipisci. Provident et dicta qui et veniam. Eos eligendi expedita veniam autem sapiente recusandae sunt sed. Repellat sit est mollitia qui ut aliquam.', 'published', 'intelijen', '2015-01-21 11:47:22', '2015-01-21 11:47:22', NULL),
